import React from 'react';
import Card from './Card';

const CardList = ({ robots }, { clicked }) => {
	const cardComponent = robots.map((user, i) => {
		return ( 
			<Card 
				key={i} 
				id={robots[i].id} 
				name={robots[i].name} 
				username={robots[i].username}
				clicked={false}
			/>
		);
	});
	return (
		<div>
			{ cardComponent }
	    </div>
	);
}

export default CardList;
